import React from "react";

const RecipeResult = ({ recipeData }) => (
    <li>
      <span class="recipe-title">{recipeData.label}</span>
      <span class="source-name">From {recipeData.source}</span>
      <a href={recipeData.url} target="_blank" title={recipeData.source}>Get the recipe</a>
    </li>
);

export default RecipeResult;
